column4:
Bonjour,

Vu avec mon assurance, la procédure :
- recommandé détaillant point par point les torts d'Icade. Inventaire précis par immeuble à faire. Qqun a-t-iol noté toutes les dates des différentes défaillances ? Leur donner un délai d’intervention;
- Sans réponse ni solution apportée de leur part, saisine optionnelle de la commission départementale de conciliation;
- saisine du tribunal d'instance. Fournir le dossier récapitulant pannes et défaillances ;
- décision de justice nous autorisant à consigner nos loyers auprès de la Caisse des Dépôts.

Bien cordialement,
